import React from 'react';
import { Link } from 'react-router-dom';

function Empleados() {
  const lista = [{id: 1, nombre: 'Ana'}, {id: 2, nombre: 'Luis'}];
  return (
    <div>
      <h2>Listado de empleados</h2>
      <Link to="/empleados/nuevo">Agregar nuevo empleado</Link>
      <ul>
        {lista.map(emp => (
          <li key={emp.id}>
            {emp.nombre} - <Link to={"/empleados/editar/" + emp.id}>Editar</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}
export default Empleados;
